sequence:
Year 1439 ( MCDXXXIX ) was a common year starting on Thursday ( link will display the full calendar ) to commemorate the death of the King Edward II, the last surviving king of England. On January 13, 1642, the first Royal Charter Act was signed between the Crown and the Parliament, in which it is stipulated that:
All persons who are entitled to the use or possession of lands belonging to the Crown for any purpose may exercise their rights by virtue of royal prerogative upon them;
There is no limit on the number of persons who may exercise the rights granted by the act.
